[Form]
public final class PurchLineOpenOrder extends FormRun implements SysIFilterConsumerForm
{
    InventDimCtrl_Frm_Mov inventDimFormSetup;

}

/// <summary>
/// Register the data source to which the filter should be applied.
/// </summary>
public void registerDatasourceOnQueryingEvent()
{
    PurchLine_ds.OnQueryExecuting += eventhandler(this.parmFilterFormQueryEventHandler().applyFilter);
}

public Common docCursor()
{
    Common docCursor = super();

    if (docCursor.TableId == tablenum(InventDim))
    {
        docCursor = purchLine;
    }

    return docCursor;
}

void init()
{
    super();

    purchTable_ds.query().dataSourceTable(tablenum(PurchTable)).addRange(fieldnum(PurchTable, PurchStatus)).value(enum2Value(PurchStatus::Backorder));
    purchLine_ds.query().dataSourceTable(tablenum(PurchLine)).addRange(fieldnum(PurchLine, PurchaseType)).value(queryValue(PurchaseType::ReturnItem));
    purchLine_ds.query().dataSourceTable(tablenum(PurchLine)).addRange(fieldnum(PurchLine, PurchaseType)).value(queryValue(PurchaseType::Purch));
    purchLine_ds.query().dataSourceTable(tablenum(PurchLine)).addRange(fieldnum(PurchLine, PurchStatus)).value(enum2Value(PurchStatus::Backorder));

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (element.args().record())
    {
        purchLine_ds.object(fieldnum(PurchLine, VendAccount)).visible(false);
    }
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement movement = InventMovement::construct(purchLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange:
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default:
            throw error(strfmt("@SYS54195", funcname()));
    }
}

public void init()
{
    super();

    QueryBuildRange rangeIsDeleted = this.query().dataSourceTable(tablenum(PurchLine)).addRange(fieldnum(PurchLine,IsDeleted));
    rangeIsDeleted.value(SysQuery::value(NoYes::No));
    rangeIsDeleted.status(RangeStatus::Hidden);
}

public void init()
{
    super();

    QueryBuildDataSource qbds = this.query().dataSourceTable(this.table());
    QueryBuildRange rangeIsDeletedSchedule = qbds.addRange(fieldnum(PurchDeliverySchedule, IsDeleted));
    rangeIsDeletedSchedule.value(SysQuery::value(NoYes::No));
    rangeIsDeletedSchedule.status(RangeStatus::Hidden);
    qbds.clearLinks();
    qbds.clearDynalinks();
    qbds.addLink(fieldNum(PurchLine, InventTransId), fieldNum(PurchDeliverySchedule, OrderLine));
}
